import React from "react";
import Table from "./Table";

const Info = ({ points, rebounds, assists, avgFG, avgThree, avgFree }) => {
  return (
    <div className="info">
      <div className="left">
        <h4>Lineup Stats</h4>
        <ul>
          <li>Total PPG: {points}</li>
          <li>Total RPG: {rebounds}</li>
          <li>Total APG: {assists}</li>
          <li>FG%: {avgFG}</li>
          <li>3PT%: {avgThree}</li>
          <li>FT%: {avgFree}</li>
        </ul>
      </div>
      <div className="right">
        <h1 className="grade">A+</h1>
      </div>
    </div>
  );
};

export default Info;
